import React, { Component } from 'react';
// import { inject, observer } from 'mobx-react';

// @inject('PublicStore')
// @observer
class SystemLayout extends Component {
    render() {
        return <div className='equip_layout'>
            {this.props.children}
        </div>;
    }
}
export default SystemLayout;
